glsl3.vert:
precision highp float;
uniform CCGlobal {
  mat4 cc_matView;
  mat4 cc_matViewInv;
  mat4 cc_matProj;
  mat4 cc_matProjInv;
  mat4 cc_matViewProj;
  mat4 cc_matViewProjInv;
  vec4 cc_cameraPos;
  vec4 cc_time;
  mediump vec4 cc_screenSize;
  mediump vec4 cc_screenScale;
};
uniform CCLocal {
  mat4 cc_matWorld;
  mat4 cc_matWorldIT;
};
in vec3 a_position;
in mediump vec2 a_uv0;
out mediump vec2 v_uv0;
in vec4 a_color;
out vec4 v_color;
void main () {
  vec4 pos = vec4(a_position, 1);
  pos = cc_matViewProj * pos;
  v_uv0 = a_uv0;
  v_color = a_color;
  gl_Position = pos;
}

glsl3.frag:
precision highp float;
uniform sampler2D texture;
in mediump vec2 v_uv0;
in vec4 v_color;
uniform WipeShader {
  lowp float wipe;
  lowp float start_angle;
  lowp float rx;
  lowp float ry;
  lowp float rw;
  lowp float rh;
  lowp float tw;
  lowp float th;
};
float get_angle(vec2 v1, vec2 v2){
  return atan(v1.x * v2.y - v1.y * v2.x, v1.x * v2.x + v1.y * v2.y);
}
void main () {
  vec4 color = v_color;
  vec4 texture_tmp = texture(texture, v_uv0);
  #if CC_USE_ALPHA_ATLAS_texture
      texture_tmp.a *= texture(texture, v_uv0 + vec2(0, 0.5)).r;
  #endif
  #if INPUT_IS_GAMMA
    color.rgb *= (texture_tmp.rgb * texture_tmp.rgb);
    color.a *= texture_tmp.a;
  #else
    color *= texture_tmp;
  #endif
  vec2 start_vector = vec2(sin(-start_angle*0.0174532925199432957692369076849),cos(-start_angle*0.0174532925199432957692369076849))*vec2(tw/rw,th/rh);
  vec2 uv_fix = (v_uv0-vec2(rx/tw,ry/th))*vec2(tw/rw,th/rh);
  float angle = get_angle(uv_fix-vec2(0.5,0.5),start_vector);
  if(angle+wipe*0.0174532925199432957692369076849 > 3.1415926535897932384626433832795){
    color.a = 0.0;
  }
  gl_FragColor = vec4(color.r, color.g, color.b, color.a);
}

